import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import Main from '../components/Main';


const Cliente = () => {
    const { id } = useParams();
    const [cliente, setCliente] = useState(null);

    useEffect(() => {
        const fetchClienteDetalhes = async () => {
            try {
                const token = localStorage.getItem('token');
                const response = await axios.get(`${process.env.REACT_APP_API_URL}/clientes/${id}`, {
                    headers: {
                        Authorization: `Bearer ${token}`,
                    },
                });
                setCliente(response.data);
            } catch (error) {
                console.error('Erro ao buscar detalhes do cliente:', error);
            }
        };

        fetchClienteDetalhes();
    }, [id]);

    if (!cliente) {
        return <p>Carregando...</p>;
    }

    return (
        <Main>
            <div id="content-wrapper" class="d-flex flex-column">


                <div id="content">





                    <div class="container-fluid">

                        <span>Id: {cliente.id}</span>
                        <h1 class="h3 mb-1 text-gray-800">{cliente.nome}</h1>


                        <div class="row">


                            <div class="col-lg-6">

                                <div class="card position-relative">
                                    <div class="card-header py-3">
                                        <h6 class="m-0 font-weight-bold text-success">Informações do cliente</h6>
                                    </div>
                                    <div class="card-body">
                                        <div class="mb-3">
                                            <code>.animated--grow-in</code>
                                        </div>
                                        <div class="small mb-1">Navbar Dropdown Example:</div>
                                        <nav class="navbar navbar-expand navbar-light bg-light mb-4">
                                            
                                        </nav>

                                    </div>
                                </div>

                            </div>


                            <div class="col-lg-6">

                                <div class="card position-relative">
                                    <div class="card-header py-3">
                                        <h6 class="m-0 font-weight-bold text-success">Fade In Animation Utilty</h6>
                                    </div>
                                    <div class="card-body">
                                        <div class="mb-3">
                                            <code>.animated--fade-in</code>
                                        </div>
                                        <div class="small mb-1">Navbar Dropdown Example:</div>
                                        <nav class="navbar navbar-expand navbar-light bg-light mb-4">
                                            <a class="navbar-brand" href="#">Navbar</a>
                                            <ul class="navbar-nav ml-auto">
                                                <li class="nav-item dropdown">
                                                    <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown"
                                                        role="button" data-toggle="dropdown" aria-haspopup="true"
                                                        aria-expanded="false">
                                                        Dropdown
                                                    </a>
                                                    <div class="dropdown-menu dropdown-menu-right animated--fade-in"
                                                        aria-labelledby="navbarDropdown">
                                                        <a class="dropdown-item" href="#">Action</a>
                                                        <a class="dropdown-item" href="#">Another action</a>
                                                        <div class="dropdown-divider"></div>
                                                        <a class="dropdown-item" href="#">Something else here</a>
                                                    </div>
                                                </li>
                                            </ul>
                                        </nav>
                                        <div class="small mb-1">Dropdown Button Example:</div>
                                        <div class="dropdown mb-4">
                                            <button class="btn btn-primary dropdown-toggle" type="button"
                                                id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true"
                                                aria-expanded="false">
                                                Dropdown
                                            </button>
                                            <div class="dropdown-menu animated--fade-in"
                                                aria-labelledby="dropdownMenuButton">
                                                <a class="dropdown-item" href="#">Action</a>
                                                <a class="dropdown-item" href="#">Another action</a>
                                                <a class="dropdown-item" href="#">Something else here</a>
                                            </div>
                                        </div>
                                        <p class="mb-0 small">Note: This utility animates the CSS opacity property, meaning
                                            it will override any existing opacity on an element being animated!</p>
                                    </div>
                                </div>

                            </div>

                        </div>

                    </div>


                </div>

            </div>
        </Main>
    );
};

export default Cliente;
